'''Jeremy Crutchley''' is a British actor and musician. He has appeared in television series such as ''Black Sails'', ''Constantine'' and ''Hannibal'' and films such as ''The Mangler'', ''Lord of War'', ''Ask the Dust'' and ''Doomsday''.

In ''[[Game of Thrones: A Telltale Games Series]]'', he voices [[Frostfinger]].
